import Header from './Header';

function Post({
  name,
  email,
  password,
  setName,
  setEmail,
  setPassword,
  handleAddUser,
}) {
  return (
    <div className='App'>
      <Header>API ADD</Header>
      <input
        type='text'
        value={name}
        placeholder='Name'
        onChange={(e) => setName(e.target.value)}
        required
      />
      <br /> <br />
      <input
        type='email'
        value={email}
        placeholder='Email'
        onChange={(e) => setEmail(e.target.value)}
        required
      />
      <br /> <br />
      <input
        type='password'
        value={password}
        placeholder='password'
        onChange={(e) => setPassword(e.target.value)}
        required
      />
      <br /> <br />
      <button type='button' onClick={handleAddUser}>
        Add User
      </button>
    </div>
  );
}

export default Post;
